create table Death (
    id int auto_increment primary key,
    countryId int not null,
    yearId int not null,
    deathCauseId int not null,
    count int not null,
    constraint Death_ibfk_1 foreign key (yearId) references Year (id),
    constraint Death_ibfk_2 foreign key (countryId) references Country (id),
    constraint Death_ibfk_3 foreign key (deathCauseId) references DeathCause (id)
);

create index countryId on Death (countryId);

create index deathCauseId on Death (deathCauseId);

create index yearId on Death (yearId);

